import PropTypes from 'prop-types';
import Article from './Article';

const ArticlesList = () => (
  <div className="row">
    <Article />
  </div>
);

ArticlesList.propTypes = {
  articles: PropTypes.array.isRequired,
};

export default ArticlesList;
